import React from "react";
import MainModule from "./Main/Main.js";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

// import header
import { Header, playOnMouseover } from "./Header/Header.js";

// import blogs displayer
import { BlogsDisplayer } from "./BlogView/BlogsDisplayer.js";

const Components = () => {
  return (
    <div>
      <Header />
      <Router>
        <Routes>
          <Route path="/" element={<BlogsDisplayer />} />
          <Route path="/create_post" element={<MainModule />} />
        </Routes>
      </Router>
    </div>
  );
};

// add animation to navbar logo
// (broken)
//let element = document.getElementById("logo");
//element.addEventListener('mouseover', function(){playOnMouseover(element)});

export default Components;
